description:
ADOBE PHOTOSHOP PLUGINS 

Geographic Imager

Geographic Imager 3.1 transforms Adobe Photoshop into a powerful spatial imagery 
editing tool. Work with satellite imagery, aerial photography, orthophotos in 
GeoTIFF and other GIS image formats using Adobe Photoshop features such as 
transparencies, filters, and image adjustments. Maintain georeferencing and 
support for hundreds of coordinate systems and projections.

In addition to GeoTIFF files, Geographic Imager support formats such as ESRI 
BIL, BigTIFF, DEM, GRID, MrSID and more. Transform, Project, Mosaic, Tile, and 
GeoCrop geospatial imagery and DEMs quickly and easily.

You need Photoshop installed first;

